import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';  // Import necessary components from React Router
import Movie from './pages/Movie';  // Import the Movie component, adjust path as necessary
import './styles/movie.css';  // Import your global styles (adjust path if needed)

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          {/* Set the root path to load the Movie component */}
          <Route exact path="/" component={Movie} />


        </Switch>
      </div>
    </Router>
  );
}

export default App;
